import React from "react";
import { Link } from "react-router-dom";
const Yok = () => (
  <div>
    <div className="text-center">
      <Link to="/bioskop" className="justify-content-center btn btn-danger">
        Test Demo Disini
      </Link>
    </div>
  </div>
);

export default Yok;
